import React from 'react';
import { Routes, Route } from "react-router-dom";
// ut';
import About from './About';
import Contact from './Contact';

const App = ()=>{
     return (
          <>
          <Routes>
          <Route index element={<About />} />
          <Route path ="/contact" component={Contact}/>  
          </Routes>  

          </>
     )
}

export default App;
